import React from 'react'
import PropTypes from 'prop-types'
//const colors = ["red", "green", "blue", "black", "brown"]
const colors = [
    { color: "#FF6263" },
    { color: "#DE4839" },
    { color: "#BF3325" },
    { color: "#E21717" },
    { color: "#BF3312" },
    { color: "#D82E2F" },
    { color: "#EB4D4B" },
    { color: "#EF5354" },
    { color: "#B4161B" },
    { color: "#E6425E" },
    { color: "#E83A59" },
    { color: "#B9345A" },
  ];
const ColorPicker = () => {
    return (
        <div>{colors.map((color, index) => {
            // console.log('color :>> ', color);
            const dat = `${color.color}`
            return (
                < div className="color_picker" style={{ backgroundColor: dat }} key={index}></div>
            )

        })}</div >
    )
}

ColorPicker.propTypes = {
    //colors: object.isRequired,
}

export default ColorPicker
